    <script>
      // esri modules and a custom module
      require([
        "dojo/_base/connect",
        "dojo/parser", 
        "extras/EmptyLayer", 
        "esri/map", 
        "esri/layers/FeatureLayer", 
        "dijit/layout/BorderContainer", 
        "dijit/layout/ContentPane", 
        "dojo/domReady!"],
        function(connect, parser, EmptyLayer) {
          // call the parser to create the dijit layout dijits
          parser.parse();

          window.map = new esri.Map("map", { 
            showAttribution: false, 
            slider: false 
          });
        
          // add an empty layer 
          //
          // note that with version 3.3 and later it is not necessary to 
          // use the EmptyLayer classâ€“ graphics and/or feature layers can 
          // be the only layer added to the map
          var el = new EmptyLayer({ wkid: 102003 });
          map.addLayer(el);
          connect.connect(el, "onLoad", function() {
            // add a feature layer
            addStatesFeatureLayer();
          });
        }
      );

      function addStatesFeatureLayer() {
        // sym and renderer
        var outline = new esri.symbol.SimpleLineSymbol()
              .setColor(dojo.colorFromHex("#fff"));
        var sym = new esri.symbol.SimpleFillSymbol()
              .setColor(new dojo.Color([52, 67, 83, 0.4]))
              .setOutline(outline);
        var renderer = new esri.renderer.SimpleRenderer(sym);
        
        // create and add the actual FL
        fl = new esri.layers.FeatureLayer("http://sampleserver1.arcgisonline.com/ArcGIS/rest/services/Demographics/ESRI_Census_USA/MapServer/5", {
          mode: esri.layers.FeatureLayer.MODE_ONDEMAND,
          outFields: ["STATE_NAME", "POP2000", "POP2007"]
        });
        fl.setRenderer(renderer);
        map.addLayer(fl);
      }
    </script>
